    const [employee, setEmployee] = useState({
        firstName: '',
        middleInitial: '',
        lastName: '',
        phoneNumber: '',
        email: '',
        position: '',
    }) 


    return (
        <Card>
            <form className={`${classes.root} ${classes.form}`} autoComplete="off" noValidate onSubmit={handleSubmit} >
                <Typography variant="h6">{currentId ? 'Editing' : 'Creating'} a Memory</Typography>
                <TextField name="creator" variant="outlined" label="Creator" fullWidth value={employee.creator} onChange={(e) => setEmployee({ ...employee, creator: e.target.value })} />
                <TextField name="title" variant="outlined" label="Title" fullWidth value={employee.title} onChange={(e) => setEmployee({ ...employee, title: e.target.value })} />
                <TextField name="message" variant="outlined" label="Message" fullWidth value={employee.message} onChange={(e) => setEmployee({ ...employee, message: e.target.value })} />
                <TextField name="tags" variant="outlined" label="Tags" fullWidth value={employee.tags} onChange={(e) => setEmployee({ ...employee, tags: e.target.value })} />
                {/* <div className={classes.fileInput}><FileBase type="file" multiple={false} onDone={({base64}) => setEmployee({ ...employee, selectedFile: base64 })} /></div> */}
                <Button className={classes.buttonSubmit} variant="contained" color="primary" size="large" type="submit" fullWidth>Submit</Button>
                {/* <Button variant="contained" color="secondary" size="small" onClick={clear} fullWidth>Clear</Button> */}
            </form>
        </Card>
    )
}

export default EmployeeForm
